import Todo from './Pages/Todo';
import Nopage from './Pages/Nopage';
import './App.css';
import {BrowserRouter,Route,Routes} from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
        <Routes>
          <Route index element={<Todo/>}/>
          <Route path='/Todo' element={<TodoW/>}/>
          <Route path='*' element={<Nopage/>}/>

        </Routes>
    </BrowserRouter>
  );
}

export default App;
